import React from 'react'
import styled from 'styled-components'


const Container = styled.div`
    display: flex;
    background-color: #1F2421;
    flex-direction: row;
    justify-content: center;

`

const Logo = styled.h1`
    color: #9CC5A1;
    text-shadow: 3px 3px #216869;
`

const Navbar = (props) => {
    return (
        <Container>
            <Logo>Logo</Logo>
        </Container>
    );
}

export default Navbar
